import axios from "axios";
import React from "react";
import CardFavorites from "./CardFavorites.jsx"

const Favorites = () => {
    React.useEffect(() => {
        axios.get("/api/auth/me")
        .then((user) => console.log(user))
        .then((favorites)=> console.log(favorites))
    })

    return(
        <>
        <CardFavorites />
        </>
    )
}

export default Favorites;
